import React, { Component } from 'react';
import EmployeeServices from '../services/EmployeeServices';

class ListEmployeeComponents extends Component {
    constructor(props) {
        super(props)
        this.state = {
            customers: []
        }
    }
    componentDidMount() {
        EmployeeServices.getCustomers().then((res) => {
            this.setState({ customers: res.data });
        });
    }
    render() {
        return (
            <div>
                <div>
                    <div className="content-wrapper">
                        {/* Content Header (Page header) */}
                        <div className="content-header">
                            <div className="container-fluid">
                                <div className="row mb-2">
                                    <div className="col-sm-6">
                                        <h4>Employye list</h4>
                                    </div>{/* /.col */}
                                    <div className="col-sm-6">
                                        <ol className="breadcrumb float-sm-right">
                                            <li className="breadcrumb-item"><a href="#">Home</a></li>
                                            <li className="breadcrumb-item active">Dashboard v2</li>
                                        </ol>


                                    </div>{/* /.col */}
                                </div>{/* /.row */}
                            </div>{/* /.container-fluid */}
                        </div>

                        <section className="content">
                            <div className="container-fluid">
                                {/* Info boxes */}


                                <div class="row">
                                    <div class="col-12">
                                        <div class="card">
                                            <div class="card-header">
                                                <h3 class="card-title">DataTable with minimal features & hover style</h3>
                                            </div>

                                            <div class="card-body">
                                                <table id="example2" class="table table-bordered table-hover">
                                                    <thead>
                                                        <tr>
                                                            <th>NIC Number</th>
                                                            <th>Full Name</th>
                                                            <th>Date of birth</th>
                                                            <th>Email address</th>
                                                            <th>CSS grade</th>
                                                        </tr>
                                                    </thead>
                                                    <tbody>
                                                        {
                                                            this.state.customers.map(
                                                                customer => <tr key={customer.cus_id}>
                                                                    <td>{customer.cusNicNumber}</td>
                                                                    <td>{customer.cusfullname}</td>
                                                                    <td>{customer.cusdob}</td>
                                                                    <td>{customer.cusemail}</td>

                                                                </tr>
                                                            )
                                                        }
                                                    </tbody>
                                                    {/* <tfoot>
                                                        <tr>
                                                            <th>Rendering engine</th>
                                                            <th>Browser</th>
                                                            <th>Platform(s)</th>
                                                            <th>Engine version</th>
                                                            <th>CSS grade</th>
                                                        </tr>
                                                    </tfoot> */}
                                                </table>
                                            </div>
                                            {/* <!-- /.card-body --> */}
                                        </div>
                                        {/* <!-- /.card --> */}

                                    </div>

                                </div>



                            </div>
                        </section>
                    </div>

                </div>
            </div>
        );
    }
}

export default ListEmployeeComponents;
